import Layout from '../components/layout';
import { Paper } from '@material-ui/core';

export default function() {
  return (
    <React.Fragment>
      <Layout>
        <Paper elevation={3} className="button-container">
          Hi
        </Paper>
      </Layout>
      <style jsx>{`
        .container {
          margin: 50px;
        }
        p {
          color: blue;
        }
      `}</style>
    </React.Fragment>
  );
}
